import React, { useState } from 'react';
import { FaBars, FaXmark } from "react-icons/fa6";
function Navbar() {
    const [ismenuopen, setIsmenuopen] = useState(false);
    const [formData, setFormData] = useState({
        firstName: '',
        lastName: '',
        email: '',
        phone: ''
    });

    const togglemnu = () => {
        setIsmenuopen(!ismenuopen);
    }

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    }

    const handleSubmit = (e) => {
        e.preventDefault();
        // Form verilerini işleme veya gönderme işlemi burada yapılabilir
        console.log(formData);
    }

    return (
        <>
            <nav className='bg-white md:px-14 py-2 max-w-screen-2xl mx-auto border-b text-purple-600 fixed top-0 left-0 right-0'>
                <div className=' container mx-auto flex justify-between items-center font-medium'>
                    <div className='  flex  space-x-14 items-center'>
                        {/* Navbar içeriği */}
                    </div>

                    <div className='space-x-12 hidden md:flex items-center '>
                        <a href="/" className='hidden lg:flex items-center bg-purple-100 hover:bg-purple-700 transition-all duration-300 rounded py-2 px-4 text-purple-800 hover:text-white  ml-52'><span>Log in</span></a>
                        <button onClick={togglemnu} className='hidden lg:flex items-center bg-purple-100 hover:bg-purple-700 transition-all duration-300 rounded py-2 px-4 text-purple-800 hover:text-white  ml-52'><span>Book Demo</span></button>
                    </div>
                    <div className='md:hidden'>
                        <button onClick={togglemnu} className='text-white focus:outline-none focus:text-gray-300'>
                            {ismenuopen ? (<FaXmark className='w-6 h-6 text-black'/>) : (<FaBars className='w-6 h-6 text-purple-500'/>)}
                        </button>
                    </div>
                </div>
            </nav>

            <div className={`space-y-4 px-4 pb-5 pt-24 bg-purple-600 ${ismenuopen ? 'block fixed top-0 right-0 left-0 ' : 'hidden'}`}>
                {/* Navbar menü içeriği */}
            </div>

            {/* Form */}
            <div className="flex justify-center items-center h-screen">
                <form onSubmit={handleSubmit} className="bg-white shadow-md rounded px-8 pt-6 pb-8 mb-4">
                    <div className="mb-4">
                        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="firstName">
                            First Name
                        </label>
                        <input 
                            className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                            id="firstName" 
                            type="text" 
                            name="firstName"
                            placeholder="First Name"
                            value={formData.firstName}
                            onChange={handleChange}
                        />
                    </div>
                    <div className="mb-4">
                        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="lastName">
                            Last Name
                        </label>
                        <input 
                            className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                            id="lastName" 
                            type="text" 
                            name="lastName"
                            placeholder="Last Name"
                            value={formData.lastName}
                            onChange={handleChange}
                        />
                    </div>
                    <div className="mb-4">
                        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="email">
                            Email
                        </label>
                        <input 
                            className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                            id="email" 
                            type="email" 
                            name="email"
                            placeholder="Email"
                            value={formData.email}
                            onChange={handleChange}
                        />
                    </div>
                    <div className="mb-4">
                        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="phone">
                            Phone
                        </label>
                        <input 
                            className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                            id="phone" 
                            type="tel" 
                            name="phone"
                            placeholder="Phone"
                            value={formData.phone}
                            onChange={handleChange}
                        />
                    </div>
                    <div className="flex items-center justify-between">
                        <button 
                            className="bg-purple-500 hover:bg-purple-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline" 
                            type="submit"
                        >
                            Submit
                        </button>
                    </div>
                </form>
            </div>
        </>
    );
}

export default Navbar;
